// AgentDashboard.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { toast } from 'react-toastify';

function AgentDashboard({ user }) {
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [newLead, setNewLead] = useState({
    name: '',
    email: '',
    phone: '',
  });
  const [error, setError] = useState('');

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const token = localStorage.getItem('token');
      
      if (!token) {
        toast.error('Authentication token not found');
        return;
      }

      // Debug logs
      console.log('User:', user);
      console.log('Token:', token);
      console.log('Agent ID:', user?.agentId); // Use agentId instead of id

      if (!user?.agentId) {
        toast.error('Agent ID not found');
        return;
      }

      const response = await axios.get(
        `http://localhost:5000/agent/${user.agentId}/dashboard`, // Use agentId
        {
          headers: {
            Authorization: `Bearer ${token}`
          }
        }
      );

      console.log('Dashboard Response:', response.data);
      setDashboardData(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Dashboard fetch error:', error);
      toast.error(error.response?.data?.message || 'Failed to load dashboard data');
      setError(error.response?.data?.message || 'Failed to load dashboard data');
      setLoading(false);
    }
  };

  // Handle lead submission
  const handleSubmitLead = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!user?.agentId || !token) {
        toast.error('Authentication required');
        return;
      }

      const response = await axios.post(
        `http://localhost:5000/agent/${user.agentId}/submit-lead`,
        newLead,
        {
          headers: { Authorization: `Bearer ${token}` },
        }
      );

      setDashboardData(response.data);
      setNewLead({ name: '', email: '', phone: '' });
      toast.success('Lead submitted successfully');
    } catch (err) {
      console.error('Lead submission error:', err);
      toast.error('Failed to submit lead. Please try again.');
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div style={{ color: 'red', padding: '20px' }}>{error}</div>;
  }

  return (
    <div className="container">
      <h1>Agent Dashboard</h1>
      {dashboardData ? (
        <div className="dashboard-content">
          <div className="stats-grid">
            <div className="stat-card">
              <h3>Total Clients</h3>
              <p>{dashboardData.totalClients || 0}</p>
            </div>
            <div className="stat-card">
              <h3>Total Investments</h3>
              <p>${dashboardData.totalInvestments || 0}</p>
            </div>
            <div className="stat-card">
              <h3>Monthly Commission</h3>
              <p>${dashboardData.monthlyCommission || 0}</p>
            </div>
          </div>
          
          {/* Recent Activities */}
          <div className="recent-activities">
            <h2>Recent Activities</h2>
            {dashboardData.recentActivities?.length > 0 ? (
              <ul>
                {dashboardData.recentActivities.map((activity, index) => (
                  <li key={index}>
                    <span className="activity-date">
                      {new Date(activity.date).toLocaleDateString()}
                    </span>
                    <span className="activity-description">{activity.description}</span>
                  </li>
                ))}
              </ul>
            ) : (
              <p>No recent activities</p>
            )}
          </div>
        </div>
      ) : (
        <p>No dashboard data available</p>
      )}

      <h3>Submit a New Lead</h3>
      <div>
        <input
          type="text"
          placeholder="Client Name"
          value={newLead.name}
          onChange={(e) => setNewLead({ ...newLead, name: e.target.value })}
          style={{ padding: '10px', marginRight: '10px', width: '300px' }}
        />
        <input
          type="email"
          placeholder="Client Email"
          value={newLead.email}
          onChange={(e) => setNewLead({ ...newLead, email: e.target.value })}
          style={{ padding: '10px', marginRight: '10px', width: '300px' }}
        />
        <input
          type="text"
          placeholder="Client Phone"
          value={newLead.phone}
          onChange={(e) => setNewLead({ ...newLead, phone: e.target.value })}
          style={{ padding: '10px', marginRight: '10px', width: '300px' }}
        />
        <button
          onClick={handleSubmitLead}
          style={{
            padding: '10px 20px',
            borderRadius: '5px',
            border: 'none',
            backgroundColor: '#007BFF',
            color: 'white',
            cursor: 'pointer',
          }}
        >
          Submit Lead
        </button>
      </div>
    </div>
  );
}

export default AgentDashboard;
